import animeData from '../data/db.json'
import ItemAnime from "../component/ItemAnime";
const Anime=()=>{
    return(
        <div className="container">
            <div class="card-deck">
                {animeData.map(anime=>
                <ItemAnime key={anime.id} anime={anime}/>)}
            </div>

        </div>
    );
}
export default Anime;
